    Given I login in the HiJack Poker\n    #     When I click the Login with Email option\n    #     And I input the test email in the login email\n    #     And I click the forget password\n    #     Then Reset password modal should be displayed\n\n    # Scenario: Verify that user cannot login with invalid credentials\n    #     Given I login in the HiJack Poker\n    #     When I click the Login with Email option\n    #     And I input invalid email for login\n    #     And I input invalid password\n    #     And I click the login button\n    #     Then The login error message should be displayed\n\n    # Scenario: Verify error message displays when incorrect password used\n    #     Given I login in the HiJack Poker\n    #     When I click the Login with Email option\n    #     And I input the test email in the login email\n    #     And I input invalid password\n    #     And I click the login button\n    #     Then The login error message should be displayed\n\n\n","uri":"cypress/e2e/Front Office/LoginPage.feature","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[{"location":{"line":1,"column":1},"name":"@login","id":"74c071a4-26c6-4541-bbe8-281dbd94378c"},{"location":{"line":1,"column":8},"name":"@regression","id":"576d8f43-37a5-47ba-97c0-ac18294d68f8"}],"location":{"line":2,"column":1},"language":"en","keyword":"Feature","name":"Front Office - Login Page","description":"","children":[{"scenario":{"id":"080c150f-e3fd-430d-917e-05ab93942dab","tags":[],"location":{"line":9,"column":5},"keyword":"Scenario","name":"Verify that player can logout and not access the website by manually entering the URL","description":"","steps":[{"id":"173e9d96-fcda-43c9-a56d-847c43fa60e4","location":{"line":11,"column":9},"keyword":"Given ","keywordType":"Context","text":"I login in the HiJack Poker"},{"id":"ebc1ac8f-eccd-456c-b9ff-adcc1327850e","location":{"line":13,"column":9},"keyword":"When ","keywordType":"Action","text":"I click the Login wit
